var $bm_rt;
var calibrate, on_off, d, s, L, center, center, myTime, angle, angle;
calibrate = $bm_div(effect('Position - Orbit Calibrate')('ADBE Slider Control-0001'), 57);
on_off = effect('Position - Orbit Direction')('ADBE Checkbox Control-0001');
d = $bm_mul(effect('Position - Orbit Distance')('ADBE Slider Control-0001'), 15);
s = $bm_div(effect('Position - Orbit Speed')('ADBE Slider Control-0001'), 10);
try {
    L = effect('Position - Orbit Target')('ADBE Layer Control-0001');
    center = L.toWorld(L.anchorPoint);
} catch (err) {
    center = value;
}
myTime = Math.max(0, $bm_sub(time, inPoint));
if (on_off == 1) {
    angle = $bm_sum($bm_mul($bm_mul($bm_mul(s, myTime), 2), Math.PI), calibrate);
} else {
    angle = $bm_mul($bm_sum($bm_mul($bm_mul($bm_mul(s, myTime), 2), Math.PI), calibrate), -1);
}
$bm_rt = value = $bm_sum(center, $bm_mul([
    $bm_div(Math.sin(angle), thisComp.pixelAspect),
    $bm_neg(Math.cos(angle))
], d));

